import styled from "styled-components";

const MainLeftNavPresenter = styled.div`
    width: 70px;
    height: 100%;

    display: flex;
    flex-direction:column;
    align-items: center;
    justify-content: center;

    background-color: #1D3DD6;
    border-right: solid 1px white;
`

export default MainLeftNavPresenter;
